        Pet::with('infos.indications._detail._service')->whereHas('infos')->get()->each(function ($pet, $i) {
            $vaccination = [];
            $pet->infos->each(function ($info, $j) use (&$vaccination) {
                $info->indications->each(function ($indication, $k) use (&$vaccination) {
                    if($indication->detail->_service->major_id == 12) {
                        $vaccination[] = (object) ['date' => $indication->created_at, 'service' => $indication->detail->_service->name];
                    }
                });
            });
            if(count($vaccination)) {
                $pet->vaccination = json_encode($vaccination);
                $pet->save();
            }
        });
